import React, { Component } from 'react';

class ItemList extends Component {
    constructor(props) {
        super(props)

        this.state = {
            items: [1, 2, 3]
        }
    }



    render() {
        return (
            <div>
                <h2>Item List</h2>
                <p>{this.props.newItem}</p>
                <p>this.state.items.map(item => <p>{item}</p>)</p>
            </div>
        );
    }
}

export default ItemList;
